import React from 'react';
// import Todoitem from './Todoitem';

const TodoBoard = ({todos}) => {

    return (
        <div>
            <h1>Todo List</h1>
            {todos.map((todo)=><todoitem
             todo={todo}key={todo.id}/>)}
        </div>
    );
};

export default TodoBoard;
